use yiibaidb;

-- ----------------------------
-- Table structure for `orders_timestamp`
-- ----------------------------
DROP TABLE IF EXISTS `orders_in_timestamp`;
CREATE TABLE `orders_in_timestamp` (
  `orderNumber` int(11) NOT NULL,
  `orderDate` timestamp(3) NOT NULL default current_timestamp(3),
  `requiredDate` timestamp(3) NOT NULL default current_timestamp(3),
  `shippedDate` timestamp(3) NOT NULL default current_timestamp(3),
  `status` varchar(15) NOT NULL,
  `comments` text,
  `customerNumber` int(11) NOT NULL,
  PRIMARY KEY (`orderNumber`),
  KEY `customerNumber` (`customerNumber`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

